import React from 'react';
import MasRes from '../resources/Master_Resume.pdf'
import MenuBar2 from '../components/MenuBar2';

function Resume(){

   
    return( 

    <div > 
    <MenuBar2 class="ui inverted menu" color='white' inverted={true} />
    <div class="resume">
    <iframe title='MasterResume' src={MasRes} width="100%" height="500px"/>
    </div> 
    </div>
    )
}
export default Resume
